declare module 'lodash-es' {
  export function flatten(array: any[]): any[];
}

declare module 'react' {
  export interface CSSProperties extends React.CSSProperties {}
  export interface ChangeEvent<T> extends React.ChangeEvent<T> {}
  export interface Component<P = {}, S = {}> extends React.Component<P, S> {}
  export interface ComponentClass<P = {}, S = {}> extends React.ComponentClass<P, S> {}
  export interface ComponentType<P = {}, S = {}> extends React.ComponentType<P, S> {}
  export interface Element extends React.Element {}
  export interface Fragment extends React.Fragment {}
  export interface KeyboardEvent<T> extends React.KeyboardEvent<T> {}
  export interface MouseEvent<T> extends React.MouseEvent<T> {}
  export interface ReactElement extends React.ReactElement {}
  export interface ReactNode extends React.ReactNode {}
  export interface Ref extends React.Ref {}
  export function cloneElement(element: React.ReactElement, props?: Partial<React.ReactElement>, children?: React.ReactNode): React.ReactElement;
  export function createClass<P, S>(component: React.ComponentClass<P, S>): React.ComponentClass<P, S>;
  export function createContext<T>(defaultValue: T): React.Context<T>;
  export function createElement(type: string | React.FunctionComponent<any>, props?: React.Attributes & React.SVGProps<SVGElement>, children?: React.ReactNode): React.ReactElement;
  export function memo(component: React.FC<any>, shouldUpdate?: (prevProps: Readonly<any>, nextProps: Readonly<any>) => boolean): React.FC<any>;
  export function useCallback(callback: (...args: any[]) => any, deps?: any[]): (...args: any[]) => any;
  export function useContext(context: React.Context<any>): any;
  export function useEffect(effect: React.EffectCallback, dependencies?: any[]): void;
  export function useLayoutEffect(effect: React.EffectCallback, dependencies?: any[]): void;
  export function useMemo(create: () => any, deps?: any[]): any;
  export function useRef(initialValue: any): React.MutableRefObject<any>;
  export function useState<S>(initialState: S): [S, React.Dispatch<React.SetStateAction<S>>];
}

declare module 'react-cosmos-core' {
  export function isReactElement(value: any): boolean;
}

declare module 'react-cosmos-renderer/client' {
  export interface RendererContext extends React.Context<any> {}
}
